import React from "react";
//import "./styles.css";
import Book1 from "./Book1";
import Book2 from "./Book2";
import Book3 from "./Book3";
import { Grid } from "@material-ui/core";


export default function App() {
    return(
           <Grid container>
               <Grid item xs={3} sm={6} md={4}>
              <Book1 />
                 </Grid>
             <Grid item xs={3} sm={6} md={4}>
              <Book2 />
                 </Grid>
                 <Grid item xs={3} sm={6} md={4}>
                 <Book3 />
          
            </Grid>
            </Grid>
    )
}
